window.bookSummaryJSON = "<p>Mac Travis thought it was easy to disappear in the Florida Keys. Living on an island; fishing, diving, and some salvage work kept him busy - until his past catches up to him. When a famous treasure hunter is murdered, Mac is handed his research of 100 lost wrecks, but to save a friend's family from a crazed competitor, he must find the right one - and find it first, before people dear to him start to die.</p> <p>The latest in the Mac Travis Adventure series from best-selling author Steven Becker is set against the backdrop of the awe-inspiring Florida Keys. If you enjoy boating, fishing, scuba diving, and the counterculture of the Keys, you will love this new stand-alone adventure.</p>"; 
